import { Fragment, useEffect } from "react"
import "./singleFilter.css"

export const SingleFilter = () => {

    var data;
    useEffect(()=> {
        (async () => {
            try {
                data = [{Category: "home_tutions"},{Category: "online"},{Category: "in_person"}]
                console.log(data)
            } catch (error) {
                console.log(error)
            }
        })()
    }, [data])

    return (
       <Fragment>
        <h1>Single Filter</h1>
        <h2>Filter Tutors</h2>
            <div id="filters">
            <span class="material-icons-outlined">keyboard_arrow_up</span>
            <br/>
                {
                    data.map((filterOptions) => <label>
                        <input type="checkbox" value={filterOptions.Category}/>
                        {filterOptions.Category}
                        <br />
                    </label>
                    )
                }
                <span class="material-icons-outlined">keyboard_arrow_down</span>
            </div>
       </Fragment>
    )
}
